%[text] %[text:anchor:T_C9C53173] # **Snail Trail Chart Examples**
%[text] **Overview**
%[text] The `SnailTrailChart` visualizes the evolution of the relative performance of an asset over time. The chart data (`Returns`) comprises a timetable with row times and variables as follows:
%[text] - `Date` - the row times of the timetable - an increasing `datetime` vector corresponding to the benchmark and asset returns;
%[text] - `Benchmark` - a numeric vector containing the return series for the performance benchmark (for example, the performance benchmark could be the returns of the FTSE100 or S&P500 indices, or another reference portfolio);
%[text] - `Asset` - a numeric vector containing the return series for the asset of interest (for example, a portfolio). \
%[text] From the chart data, the following performance metrics are computed in rolling windows:
%[text] - Excess return - the mean of the difference between the asset and the benchmark returns;
%[text] - Tracking error - the standard deviation of the difference between the asset and the benchmark returns;
%[text] - Information ratio - the ratio of the excess return to the tracking error. \
%[text] The chart creates a scatter graph of excess return against tracking error, colored by information ratio. The reference lines $x=0$ and $y=0$ are highlighted to separate the two quadrants for which $x\>0$. The snail trail is plotted over the scatter graph, and comprises a head and a trail. A text box displays the performance statistics corresponding to the position of the head.
%[text] ![SnailTrailChart.png](text:image:10b8)
%[text] The `Period` property of the chart specifies the window length (that is, the number of observations used in each rolling window). The head of the trail is set using either the `CurrentIndex` (an integer) or `CurrentDate` (a `datetime`) chart properties. The length of the trail is controlled by modifying the `TrailLength` property. To move the snail trail around the chart, use the `step`, `animate` and `reset` methods.
%[text] **Documentation**
%[text] - [`scatter`](<matlab: doc("scatter")>): Scatter plot
%[text] - [`text`](<matlab: doc("text")>): Add text descriptions to data points \
%[text:tableOfContents]{"heading":"Table of Contents"}
%[text] 
%%
%[text] %[text:anchor:H_2B514E45] ## Load the data.
load( fullfile( chartsRoot(), "data", "Returns.mat" ), "rets" )
%%
%[text] %[text:anchor:H_F6FFFDEC] ## Create a figure for the chart.
f = exampleFigure( "Name", "SnailTrailChart Example" );
%%
%[text] %[text:anchor:H_B0BCACCD] ## Create the chart.
STC = SnailTrailChart( "Parent", f, ... %[output:group:17073d4b] %[output:18a3fbb3]
    "Returns", rets ); %[output:group:17073d4b] %[output:18a3fbb3]
%%
%[text] %[text:anchor:H_59D5212A] ## Customize the chart appearance.
xlabel( STC, "Tracking error", "FontSize", 14 ) %[output:30b90d61]
ylabel( STC, "Excess return", "FontSize", 14 ) %[output:30b90d61]
title( STC, "Snail Trail Chart", "FontSize", 16 ) %[output:30b90d61]
%%
%[text] %[text:anchor:H_8954AEBC] ## Step the trail.
numSteps = 20;
step( STC, numSteps ) %[output:0d4028e2]
%[text] Adjust the trail length.
STC.TrailLength = 15; %[output:0d4028e2]
%%
%[text] %[text:anchor:H_CEEA15C4] ## Update the chart data.
rng( "default" )
sampleRets = 0.25 * randn( height( rets ), 2 );
sampleRets = array2timetable( sampleRets, "RowTimes", rets.Date );
STC.Returns = sampleRets; %[output:25053b24]
%%
